<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Turing 2.0 Animation Ver. 3</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        min-height: 100vh;
        display: grid;
        place-items: center;
      }

      .wrapper {
        width: 100%;
        max-width: 1080px;
      }

      #lock {
        transform-origin: center;
        transform-box: fill-box;
        transform: translateY(-10px);
      }

      #logo:hover #lock {
        animation: lock 1s forwards;
      }

      @keyframes lock {
        0% {
          transform: translateY(-10px);
        }

        50% {
          transform: translateY(0px);
        }

        100% {
          transform: translateY(-10px);
        }
      }

      #lock-stroke {
        transform-box: fill-box;
        transform-origin: center;
        /* transform: translateY(0px); */
        /* transition: all 0.75s; */
        transform: translateY(30px) scale(0.9);
      }

      #logo:hover #lock-stroke {
        animation: lock__stroke 1s forwards;
        /* transform: translateY(30px) scale(0.9); */
      }

      @keyframes lock__stroke {
        0% {
          transform: translateY(30px) scale(0.9);
        }

        50% {
          transform: translateY(0px) scale(1);
        }

        100% {
          transform: translateY(30px) scale(0.9);
        }
      }

      #key-place {
        transform-box: fill-box;
        transform-origin: center;
        /* transform: scale(1); */
        transform: scale(0);
        transition: all 0.5s;
      }

      #logo:hover #key-place {
        /* transition-delay: 0.25s;
        transform: scale(0); */
        animation: key__place 1s forwards;
      }

      @keyframes key__place {
        0% {
          transform: scale(0);
        }

        50% {
          transform: scale(1);
        }

        100% {
          transform: scale(0);
        }
      }

      #lock-t {
        transform-box: fill-box;
        transform-origin: center;
        transform: scale(1);
        transition: all 0.5s;
      }

      #logo:hover #lock-t {
        /* transform-box: fill-box;
        transform-origin: center;
        transition-delay: 0.5s;
        transform: scale(1); */
        animation: site__t 1s forwards;
      }

      @keyframes site__t {
        0% {
          transform: scale(1);
        }

        50% {
          transform: scale(0);
        }

        100% {
          transform: scale(1);
        }
      }

      #site-url,
      #brand-name {
        opacity: 0;
        transform-box: fill-box;
        transform-origin: center;
        transform: translateY(40%);
        transition: all 0.5s;
      }

      #logo:hover #site-url,
      #logo:hover #brand-name {
        transition-delay: 0.75s;
        opacity: 1;
        transform: translateY(0px);
      }

      #list-1,
      #list-2,
      #list-3 {
        opacity: 0;
        transform-box: fill-box;
        transform-origin: center;
        transform: translateY(-40%);
      }

      #logo:hover #list-1,
      #logo:hover #list-2,
      #logo:hover #list-3 {
        opacity: 1;
        transform: translateY(0px);
        transition: all 0.5s;
        transition-delay: 0.75s;
        transition-timing-function: ease-in-out;
      }

      #logo:hover #list-1 {
        transition-delay: 1s;
      }

      #logo:hover #list-2 {
        transition-delay: 1.25s;
      }

      #logo:hover #list-3 {
        transition-delay: 1.5s;
      }

      #divider-line {
        transform-box: fill-box;
        transform-origin: center;
        transform: scaleX(0);
        transition: all 0.5s;
        transition-timing-function: ease-in-out;
      }

      #logo:hover #divider-line {
        transition-delay: 0.75s;
        transform: scaleX(1);
      }

      #list-1,
      #list-2,
      #list-3 {
        opacity: 0;
      }

      #top-layer {
        transform-box: fill-box;
        transform-origin: 50px center;
        transform: scaleX(0);
        transition: all 1s;
        transition-timing-function: ease-in-out;
      }

      #logo:hover #top-layer {
        transition-delay: 0.2s;
        transform: scaleX(1);
      }

      #t-1,
      #t-2,
      #t-3,
      #t-4,
      #t-5,
      #t-6,
      #t-7,
      #t-8,
      #t-9,
      #t-10,
      #t-11 {
        transform-box: fill-box;
        transform-origin: center;
        opacity: 1;
        transition: all 0.5s;
        transition-timing-function: ease-in-out;
      }

      #logo:hover #t-1,
      #logo:hover #t-2,
      #logo:hover #t-3,
      #logo:hover #t-4,
      #logo:hover #t-5,
      #logo:hover #t-6,
      #logo:hover #t-7,
      #logo:hover #t-8,
      #logo:hover #t-9,
      #logo:hover #t-10,
      #logo:hover #t-11 {
        opacity: 0;
        transform: translateX(20%);
      }

      #logo:hover #t-2 {
        transition-delay: 0.1s;
      }

      #logo:hover #t-3 {
        transition-delay: 0.2s;
      }

      #logo:hover #t-4 {
        transition-delay: 0.3s;
      }

      #logo:hover #t-5 {
        transition-delay: 0.4s;
      }

      #logo:hover #t-6 {
        transition-delay: 0.5s;
      }

      #logo:hover #t-7 {
        transition-delay: 0.6s;
      }

      #logo:hover #t-8 {
        transition-delay: 0.7s;
      }

      #logo:hover #t-9 {
        transition-delay: 0.8s;
      }

      #logo:hover #t-10 {
        transition-delay: 0.9s;
      }

      #logo:hover #t-11 {
        transition-delay: 0.9s;
      }

      #secured-text {
        transform-box: fill-box;
        transform-origin: center;
        transition: all 1s;
        transition-timing-function: ease-in-out;
      }

      #logo:hover #secured-text {
        opacity: 0;
        transform: translateX(20%);
      }
    </style>
  </head>
